import React from 'react';
import {Link} from 'react-router-dom';
import logo from "./doc.jpeg"

function Home() {
  return (
    <div className="home">
        <header><h1>Clinic</h1></header>
        <div className="card">
            <div className="card-header">
                Dr. ABC
            </div>

            <div className="card-body">
                <img src={logo} className="logo1" alt="doc"/>
                <h5 className="card-title">Surgeon</h5>
                <Link to='/schedule'>
                    <button type="button" className="btn btn-danger" data-toggle="tooltip" data-placement="right" title="Tooltip on right">Book Appointment</button>
                </Link><br/><br/>
                <Link to='/docDetails'>
                    <button className="btn btn-primary">View Doctor Details</button>
                </Link>
            </div>
        </div><br />


    </div>
  );
}


export default Home;
